import GoogleMapReact, { BootstrapURLKeys, MapOptions } from 'google-map-react';
import React , {Component}from 'react'
const center = { lat: 0, lng: 0 };

const key: BootstrapURLKeys = { key: 'AIzaSyBDGR6kCXWTIGF3zKlp9JQRqvoUC2-Ti-Y', libraries: "places" };
const client: BootstrapURLKeys = { client: 'AIzaSyBDGR6kCXWTIGF3zKlp9JQRqvoUC2-Ti-Y', v: '3.28' , language: 'en', libraries: "places", region: "PR" };
const options: MapOptions = {
    zoomControl: false,
    gestureHandling: 'cooperative',
    styles: [
        {
            featureType: "administrative",
            elementType: "all",
            stylers: [ {saturation: "-100"} ]
        },
        {
            featureType: "administrative.neighborhood",
            stylers: [ {visibility: "off" } ]
        },
        {
            elementType: "labels.text.stroke",
            stylers: [ {color: "#242f3e"} ]
        },
        {
            stylers: [ {color: "#fcfffd"} ]
        }
    ],
};
export default class MyComponent extends Component<{},{}>{
  render(){
    return(
      <GoogleMapReact key='AIzaSyBDGR6kCXWTIGF3zKlp9JQRqvoUC2-Ti-Y' center={center} heatmapLibrary={true} zoom={3} bootstrapURLKeys={client} options={options} />
    )
  }
}
